Some fixes to the Permission UX article (#7696)

Removed redundant word ("instant" ) in sentence; fixed typos;
added missing commas.

Remove warning about user gesture propagation through Promises (#7499)

crbug.com/404161 has been resolved so the following code will now work
as of Chrome 72:

  let devices = await navigator.usb.getDevices();
  // See if |devices| contains the device you are interested in. If not,
  let device = await navigator.usb.requestDevice();

